import React from 'react';
import axios from 'axios';

const Map = () => {

    const [city, setCity] = React.useState('');

    const getCity = async () => {
        try {
            const getData = await axios.get(`http://192.168.1.79:3001/city/`);
            setCity(prevCity => prevCity = getData.data);
        } catch (err) {
            console.log(err);
        }
    }

    React.useEffect(() => {
        getCity();
    }, [])

    return(
        <div className="map-screen">
            <div id="map-view" className="map-view" ref={mapRef} height="600px" width="850px">
                <iframe
                    width="850"
                    height="600"
                    style="border:0"
                    loading="lazy"
                    allowfullscreen
                    referrerpolicy="no-referrer-when-downgrade"
                    src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyBxp-dqVFMGgm6IkWnY4Nxbq6573Mf7hmI
                        &q=${city}`}>
                </iframe>
            </div>
        </div>
    )
}
export default Map;
